import { StyleSheet } from "react-native";

export const homeStyle = StyleSheet.create({
    page: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
        backgroundColor:"rgb(0,121,194)"
      },
    container: {
        height: "100%",
        width: "100%",
        flex: 1
      }
})
